ga1Z(){return"The site exhibits a multitude of architectural styles, reminiscent of styles seen in central Mexico and of the Puuc and Chenes styles of the Northern Maya lowlands."},
ga2_(){return"The city comprised an area of at least 1.9 sq miles (5 sq km) of densely clustered architecture."},
ga2e(){return"\u201cAncient Maya 101 | National Geographic.\u201d Youtube, uploaded by National Geographic."},
ga26(){return"Map showing location of Chichen Itza in Yucat\xe1n State, Mexico."},
ga22(){return'Chichen Itza was a powerful regional capital controlling north and central Yucat\xe1n. The earliest hieroglyphic date discovered at Chichen Itza is equivalent to 832 CE, while the last known date was recorded in the Osario temple in 998 CE.\nDominating the North Platform of Chichen Itza is the famous Temple of Kukulc\xe1n. The temple was identified by the first Spaniards to see it, as El Castillo ("the castle"), and it regularly is referred to as such.'},
ga23(){return"The city was thought to have the most diverse population in the Maya world, a factor that could have contributed to this architectural variety."},
ga20(){return"The structures of Chichen Itza were built from precisely chiseled limestone blocks that fit together perfectly without the mortar. Many of these stone buildings were originally painted in red, green, blue and purple colors depending on the availability of the pigments.\nThe stepped pyramid El Castillo stands about 98 feet (30 m) high and consists of a series of nine square terraces, each approximately 8.4 feet (2.57 m) high, with a 20 foot (6 m) high temple upon the summit."},
ga21(){return"It was built upon broken terrain, which was artificially leveled to support structures such as the Castillo pyramid. Important buildings within the center were connected by a dense network of paved roads called sacbeob."},
ga24(){return"Chichen Itza is located in the eastern portion of Yucat\xe1n state in Mexico. Nearby, four large sinkholes, called cenotes, could have provided plentiful water year round at Chichen, making it attractive for settlement."},
ga25(){return'Of these cenotes, the "Cenote Sagrado" or Sacred Cenote, was used for the sacrifice of precious objects and human beings as a form of worship to the Maya rain god Chaac.'},
ga1U(){return"Chichen Itza rises to regional prominence toward the end of the Early Classic period"},
ga1V(){return"The earliest hieroglyphic date discovered at Chichen Itza"},
ga1W(){return"Last known date recorded in the Osario temple"},
ga1R(){return"Chichen Itza declines as a regional center"},
ga1S(){return"Invaded by Spanish Conquistador Francisco de Montejo"},
ga1T(){return"All Spanish are driven from the Yucat\xe1n Peninsula"},
