ga2o(){return"Brazil"},
ga2z(){return"A Perfect Union Between"},
ga2y(){return"Nature and Architecture"},
ga2A(){return"The statue looms large on the landscape, but it hides as much as it reveals about the diverse religious life of Brazilians."},
ga2B(){return"Thomas Tweed"},
ga2p(){return"The statue of Christ the Redeemer with open arms, a symbol of peace, was chosen."},
ga2q(){return"Construction took nine years, from 1922 to 1931, and cost the equivalent of US$250,000 (equivalent to $3,600,000 in 2020) and the monument opened on October 12, 1931."},
ga2F(){return"\u201cThe Majestic Statue of Christ the Redeemer - Seven Wonders of the Modern World - See U in History.\u201d Youtube, uploaded by See U in History / Mythology."},
ga2x(){return"Map showing location of Christ the Redeemer in Rio de Janeiro, Brazil."},
ga2t(){return"The placement of a Christian monument on Mount Corcovado was first suggested in the mid-1850s to honor Princess Isabel, regent of Brazil and the daughter of Emperor Pedro II, but the project was not approved.\nIn 1889 the country became a republic, and owing to the separation of church and state the proposed statue was dismissed."},
ga2u(){return'The Catholic Circle of Rio made a second proposal for a landmark statue on the mountain in 1920. The group organized an event called Semana do Monumento ("Monument Week") to attract donations and collect signatures to support the building of the statue. The organization was motivated by what they perceived as "Godlessness" in the society.\nThe designs considered for the "Statue of the Christ" included a representation of the Christian cross, a statue of Jesus with a globe in his hands, and a pedestal symbolizing the world.'},
ga2r(){return"Artist Carlos Oswald and local engineer Heitor da Silva Costa designed the statue. French sculptor Paul Landowski created the work. In 1922, Landowski commissioned fellow Parisian Romanian sculptor Gheorghe Leonida, who studied sculpture at the Fine Arts Conservatory in Bucharest and in Italy."},
ga2s(){return"A group of engineers and technicians studied Landowski's submissions and felt building the structure of reinforced concrete instead of steel was more suitable for the cross-shaped statue. The concrete making up the base was supplied from Limhamn, Sweden. The outer layers are soapstone, chosen for its enduring qualities and ease of use."},
ga2v(){return'Corcovado, which means "hunchback" in Portuguese, is a mountain in central Rio de Janeiro, Brazil. It is a 2,329 foot (710 m) granite peak located in the Tijuca Forest, a national park.'},
ga2w(){return"Corcovado hill lies just west of the city center but is wholly within the city limits and visible from great distances."},
ga2i(){return"Plans for the statue were first proposed by Pedro Maria Boss upon Mount Corcovado. This was never approved, however."},
ga2j(){return"A new plan was proposed by the Roman Catholic archdiocese, and after the citizens of Rio de Janeiro petitioned the president, it was finally approved."},
ga2k(){return"The foundation of the statue was ceremoniously laid out to commemorate Brazil\u2019s independence from Portugal."},
ga2l(){return"Construction officially began after the initial design was chosen via a competition and amended by Brazilian artists and engineers."},
ga2m(){return"Construction of the statue was completed, standing 98\u2019 tall with a 92\u2019 wide arm span."},
ga2n(){return"A chapel was consecrated at the statue\u2019s base to Our Lady of Aparecida to mark the statue\u2019s 75th anniversary."},
