ga3b(){return"Still the Largest Standing"},
ga3a(){return"Amphitheater in the World Today"},
ga3c(){return"When falls the Coliseum, Rome shall fall; And when Rome falls - the World."},
ga3d(){return"Lord Byron"},
ga31(){return"It was used for gladiatorial contests and public spectacles including animal hunts, executions, reenactments of famous battles, and dramas based on Roman mythology, and mock sea battles."},
ga32(){return"It is the largest ancient amphitheater ever built, and is still the largest standing amphitheater in the world today, despite its age."},
ga3h(){return"\u201cAncient Rome 101 | National Geographic.\u201d Youtube, uploaded by National Geographic."},
ga39(){return"Map showing location of Colosseum in Rome, Italy,"},
ga35(){return"The Colosseum is an oval amphitheater in the center of the city of Rome, Italy. Unlike Roman theaters that were built into hillsides, the Colosseum is an entirely free-standing structure."},
ga36(){return"The building ceased to be used for entertainment in the early medieval era. By the late 6th century a small chapel had been built into the structure of the amphitheater, and the arena was converted into a cemetery. \nThe numerous vaulted spaces in the arcades under the seating were converted into housing and workshops, and are recorded as still being rented out as late as the 12th century."},
ga33(){return"Construction began under the emperor Vespasian (r. 69-79 CE) in 72 and was completed in 80 CE under his successor and heir, Titus (r. 79-81). Further modifications were made during the reign of Domitian (r. 81-96).\nThe Colosseum is built of travertine limestone, tuff (volcanic rock), and brick-faced concrete. The outer wall is estimated to have required over 3.5 million cubic feet of travertine stone which were set without mortar; they were held together by 300 tons of iron clamps."},
ga34(){return"It could hold an estimated 50,000 to 80,000 spectators at various points in its history, having an average audience of some 65,000."},
ga37(){return'Following the Great Fire of Rome in 64 CE, Emperor Nero seized much of the destroyed area to build his grandiose Domus Aurea ("Golden House"). A severe embarrassment to Nero\'s successors, parts of this extravagant palace and grounds, encompassing 1 sq mile, were filled with earth and built over.'},
ga38(){return"On the site of the lake, in the middle of the palace grounds, Emperor Vespasian would build the Colosseum as part of a Roman resurgence."},
ga2Y(){return"Colosseum construction was started during the Vespasian reign overtop what used to be a private lake for the previous four emperors. This was done in an attempt to revitalize Rome from their tyrannical reign."},
ga2Z(){return"The uppermost floor was built, and the structure was officially completed by Domitian."},
ga2U(){return"The arena was repurposed as a fortress for the Frangipane and Annibaldi families. It was also at one point used as a church."},
ga2V(){return"Pope Alexander VI permitted the site to be used as a quarry, for both storing and salvaging building materials."},
ga2W(){return"Preservation of the colosseum officially began, after more than a millennia of dilapidation and vandalism. Pope Pius VIII was notably devoted to this project."},
ga2X(){return"A restoration project was undertaken to ensure the colosseum remained a major tourist attraction for Rome. It currently stands as one of the greatest sources of tourism revenue in Italy."},
