ga9l(){return"The ancient wonder"},
ga9k(){return"Cairo, Egypt"},
ga95(){return"Egyptian"},
ga96(){return"Egypt"},
ga9h(){return"The Tallest Structures on Earth"},
ga9g(){return"Until the Advent of Modern Skyscrapers"},
ga9i(){return"From the heights of these pyramids, forty centuries look down on us."},
ga9j(){return"Napoleon Bonaparte"},
ga97(){return"It is theorized the pyramid not only served as a tomb for the pharaoh, but also as a storage pit for various items he would need in the afterlife."},
ga98(){return"The Great Pyramid consists of an estimated 2.3 million blocks. Approximately 5.5 million tonnes of limestone, 8,000 tonnes of granite, and 500,000 tonnes of mortar were used in the construction."},
ga9n(){return"\u201cThe Great Pyramids of Giza | Egypt\u2019s Ancient Mysteries | National Geographic UK.\u201d Youtube, uploaded by National Geographic UK."},
ga9f(){return"Map showing location of Giza Pyramids in Greater Cairo, Egypt."},
ga9b(){return"The Giza pyramid complex, also called the Giza necropolis, is the site on the Giza Plateau in Greater Cairo, Egypt that includes the Great Pyramid of Giza, the Pyramid of Khafre, and the Pyramid of Menkaure, along with their associated pyramid complexes and the Great Sphinx of Giza. All were built during the Fourth Dynasty of the Old Kingdom of Ancient Egypt, between 2600 and 2500 BCE."},
ga9c(){return"The pyramids of Giza and others are thought to have been constructed to house the remains of the deceased pharaohs who ruled over Ancient Egypt. A portion of the pharaoh's spirit called his ka was believed to remain with his corpse. Proper care of the remains was necessary in order for the former Pharaoh to perform his new duties as king of the dead."},
ga99(){return"Most construction theories are based on the idea that the pyramids were built by moving huge stones from a quarry and dragging and lifting them into place. In building the pyramids, the architects might have developed their techniques over time.\nThey would select a site on a relatively flat area of bedrock \u2014 not sand \u2014 which provided a stable foundation. After carefully surveying the site and laying down the first level of stones, they constructed the pyramids in horizontal levels, one on top of the other."},
ga9a(){return"For the Great Pyramid, most of the stone for the interior seems to have been quarried immediately to the south of the construction site. The smooth exterior of the pyramid was made of a fine grade of white limestone that was quarried across the Nile.\nTo ensure that the pyramid remained symmetrical, the exterior casing stones all had to be equal in height and width. Workers might have marked all the blocks to indicate the angle of the pyramid wall and trimmed the surfaces carefully so that the blocks fit together. During construction, the outer surface of the stone was smooth limestone; excess stone has eroded as time has passed."},
ga9d(){return"The site is at the edges of the Western Desert, approximately 5.6 miles (9 km) west of the Nile River in the city of Giza, and about 8 miles (13 km) southwest of the city center of Cairo."},
ga9e(){return"Currently, the pyramids are located in the northwestern side of the Western Desert, and it is considered to be one of the best recognizable and the most visited tourist attractions of the planet."},
ga93(){return"Construction of the 3 pyramids began for three kings of the 4th dynasty; Khufu, Khafre, and Menkaure."},
ga92(){return"Construction began on the smaller surrounding structures called Mastabas for royalty of the 5th and 6th dynasties."},
ga94(){return"Greek Author Herodotus speculated that the pyramids were built in the span of 20 years with over 100,000 slave labourers. This assumption would last for over 1500 years"},
ga9_(){return"Tomb of Queen Hetepheres was discovered, containing furniture and jewelry. One of the last remaining treasure-filled tombs after many years of looting and plundering."},
ga90(){return"Designated a UNESCO World Heritage Site to prevent any more unauthorized plundering and vandalism."},
ga91(){return"Discovery of labouror\u2019s districts suggest that the workers building the pyramids were not slaves, and an ingenious building method proved a relatively small work-force was required to build such immense structures."},
gaaq(){return"Taj Mahal"},
gaap(){return"Heaven on Earth"},
gaao(){return"Agra, India"},
gaa8(){return"Mughal"},
gaa9(){return"India"},
gaal(){return"Not just a Monument,"},
gaak(){return"but a Symbol of Love."},
gaaj(){return"Suman Pokhrel"},
gaam(){return"The Taj Mahal rises above the banks of the river like a solitary tear suspended on the cheek of time."},
gaan(){return"Rabindranath Tagore"},
gaaa(){return"The Taj Mahal is distinguished as the finest example of Mughal architecture, a blend of Indian, Persian, and Islamic styles."},
gaab(){return"It took the efforts of 22,000 laborers, painters, embroidery artists and stonecutters to shape the Taj Mahal."},
gaar(){return"\u201cIndia\u2019s Taj Mahal Is an Enduring Monument to Love | National Geographic.\u201d Youtube, uploaded by National Geographic."},
gaai(){return"Map showing location of Taj Mahal in Uttar Pradesh, India."},
gaae(){return"The Taj Mahal is an ivory-white marble mausoleum on the right bank of the river Yamuna in the Indian city of Agra. It was commissioned in 1632 CE by the Mughal emperor Shah Jahan (r. 1628-1658) to house the tomb of his favorite wife, Mumtaz Mahal; it also houses the tomb of Shah Jahan himself."},
gaaf(){return"The tomb is the centerpiece of a 42-acre (17-hectare) complex, which include twin mosque buildings (placed symmetrically on either side of the mausoleum), a guest house, and is set in formal gardens bounded on three sides by walls."},
gaac(){return"The Taj Mahal was constructed using materials from all over India and Asia. It is believed over 1,000 elephants were used to transport building materials.\nThe translucent white marble was brought from Rajasthan, the jasper from Punjab, jade and crystal from China. The turquoise was from Tibet and the lapis from Afghanistan, while the sapphire came from Sri Lanka. In all, twenty-eight types of precious and semi-precious stones were inlaid into the white marble."},
gaad(){return"An area of roughly 3 acres was excavated, filled with dirt to reduce seepage, and leveled at 160 ft above riverbank. In the tomb area, wells were dug and filled with stone and rubble to form the footings of the tomb.\nThe plinth and tomb took roughly 12 years to complete. The remaining parts of the complex took an additional 10 years."},
gaag(){return"India's most famed building, it is situated in the eastern part of the city on the southern bank of the Yamuna River, nearly 1 mile east of the Agra Fort, also on the right bank of the Yamuna."},
gaah(){return"The Taj Mahal is built on a parcel of land to the south of the walled city of Agra. Shah Jahan presented Maharaja Jai Singh with a large palace in the center of Agra in exchange for the land."},
gaa2(){return"Built by Mughal Emperor Shah Jah\u0101n to immortalize his deceased wife."},
gaa3(){return"Construction completed. The project involved over 20,000 workers and spanned 42 acres."},
gaa4(){return"There were plans for a second mausoleum for his own remains, but Shah Jah\u0101n was imprisoned by his son for the rest of his life in Agra Fort, and this never came to pass."},
gaa5(){return"Lord Curzon and the British Viceroy of India carried out a major restoration to the monument after over 350 years of decay and corrosion due to factory pollution and exhaust."},
gaa6(){return"To protect the structure from Sikh militants and some Hindu nationalist groups, night viewing was banned to tourists. This ban would last 20 years."},
gaa7(){return"Restoration and research program put into action to help preserve the monument."},
